import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';

interface SensorDashboardProps {
  habitatData: any;
}

const SensorDashboard: React.FC<SensorDashboardProps> = ({ habitatData }) => {
  // Sample data for demonstration
  const temperatureData = [
    { time: '10:00', temp: 22 },
    { time: '10:05', temp: 24 },
    { time: '10:10', temp: 23 },
    { time: '10:15', temp: 25 },
    { time: '10:20', temp: 21 },
    { time: '10:25', temp: 23 },
    { time: '10:30', temp: 24 },
  ];

  // Extract values from habitat data if available
  const temperature = habitatData?.environmental_parameters?.temperature || 22;
  const radiation = habitatData?.environmental_parameters?.radiation || 45;
  const co2Level = habitatData?.environmental_parameters?.co2 || 0.04;
  const o2Level = habitatData?.environmental_parameters?.o2 || 20.9;

  // Radiation gauge data
  const radiationGaugeData = [
    { name: 'Low', value: radiation < 30 ? 100 : 0, color: '#10b981' },
    { name: 'Medium', value: radiation >= 30 && radiation < 60 ? 100 : 0, color: '#f59e0b' },
    { name: 'High', value: radiation >= 60 ? 100 : 0, color: '#ef4444' },
  ];

  return (
    <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
      {/* Temperature Chart */}
      <div className="bg-gray-700 p-4 rounded-lg">
        <h4 className="font-semibold mb-2">Temperature (°C)</h4>
        <div className="flex items-center">
          <div className="text-3xl font-bold mr-4">{temperature.toFixed(1)}°</div>
          <div className="flex-1 h-20">
            <ResponsiveContainer width="100%" height="100%">
              <LineChart data={temperatureData}>
                <CartesianGrid strokeDasharray="3 3" stroke="#444" vertical={false} />
                <XAxis dataKey="time" hide={true} />
                <YAxis hide={true} domain={['dataMin - 5', 'dataMax + 5']} />
                <Tooltip />
                <Line 
                  type="monotone" 
                  dataKey="temp" 
                  stroke="#3b82f6" 
                  strokeWidth={2} 
                  dot={false} 
                  activeDot={{ r: 6 }} 
                />
              </LineChart>
            </ResponsiveContainer>
          </div>
        </div>
      </div>

      {/* Radiation Level */}
      <div className="bg-gray-700 p-4 rounded-lg">
        <h4 className="font-semibold mb-2">Radiation (mSv/h)</h4>
        <div className="flex items-center">
          <div className="text-3xl font-bold mr-4">{radiation.toFixed(1)}</div>
          <div className="flex-1 h-20">
            <ResponsiveContainer width="100%" height="100%">
              <LineChart data={[{ radiation, name: 'current' }]}>
                <CartesianGrid strokeDasharray="3 3" stroke="#444" vertical={false} />
                <XAxis dataKey="name" hide={true} />
                <YAxis domain={[0, 100]} hide={true} />
                <Tooltip />
                <Line 
                  type="monotone" 
                  dataKey="radiation" 
                  stroke={radiation < 30 ? "#10b981" : radiation < 60 ? "#f59e0b" : "#ef4444"} 
                  strokeWidth={2} 
                  dot={false} 
                  activeDot={{ r: 6 }} 
                />
              </LineChart>
            </ResponsiveContainer>
          </div>
        </div>
      </div>

      {/* CO2 Level */}
      <div className="bg-gray-700 p-4 rounded-lg">
        <h4 className="font-semibold mb-2">CO2 Level (%)</h4>
        <div className="flex items-center">
          <div className="text-3xl font-bold mr-4">{co2Level.toFixed(2)}%</div>
          <div className="flex-1 h-20">
            <ResponsiveContainer width="100%" height="100%">
              <LineChart data={[{ co2: co2Level, name: 'current' }]}>
                <CartesianGrid strokeDasharray="3 3" stroke="#444" vertical={false} />
                <XAxis dataKey="name" hide={true} />
                <YAxis domain={[0, 1]} hide={true} />
                <Tooltip />
                <Line 
                  type="monotone" 
                  dataKey="co2" 
                  stroke={co2Level < 0.05 ? "#10b981" : co2Level < 0.1 ? "#f59e0b" : "#ef4444"} 
                  strokeWidth={2} 
                  dot={false} 
                  activeDot={{ r: 6 }} 
                />
              </LineChart>
            </ResponsiveContainer>
          </div>
        </div>
      </div>

      {/* O2 Level */}
      <div className="bg-gray-700 p-4 rounded-lg">
        <h4 className="font-semibold mb-2">O2 Level (%)</h4>
        <div className="flex items-center">
          <div className="text-3xl font-bold mr-4">{o2Level.toFixed(1)}%</div>
          <div className="flex-1 h-20">
            <ResponsiveContainer width="100%" height="100%">
              <LineChart data={[{ o2: o2Level, name: 'current' }]}>
                <CartesianGrid strokeDasharray="3 3" stroke="#444" vertical={false} />
                <XAxis dataKey="name" hide={true} />
                <YAxis domain={[15, 25]} hide={true} />
                <Tooltip />
                <Line 
                  type="monotone" 
                  dataKey="o2" 
                  stroke={o2Level > 19 ? "#10b981" : o2Level > 17 ? "#f59e0b" : "#ef4444"} 
                  strokeWidth={2} 
                  dot={false} 
                  activeDot={{ r: 6 }} 
                />
              </LineChart>
            </ResponsiveContainer>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SensorDashboard;
